import Footer from "../footer";
import Navbar from "../header";
import styled from "styled-components";

const SocialCard=styled.section`
margin:0;
position:relative;
margin-top:22%;
height:800px;
display:grid;
grid-template-rows:5% 5% 5% 40%;
.social-heading{
    margin:0;
}
.social-subtitle{
    margin:0;
}
.social-hr
{width:60%;
height:0px;
border-top:solid 3px #1d1d1d;}
 `;

function Social() {
    return(
        <>
        <Navbar/>

        <SocialCard>
            <h1 className="social-heading">SEGUICI SUI SOCIAL!</h1>
            <h4 className="social-subtitle"> per restare aggiornato su sconti, promozioni e tanto altro!</h4>
            <hr className="social-hr"/>
            <div className="social-line">
                <img src="https://img.icons8.com/ios-filled/344/instagram-new--v1.png" alt="icona" className="social-icon" />
                <img src="https://img.icons8.com/ios-filled/344/instagram-new--v1.png" alt="icona" className="social-icon" />
                <img src="https://img.icons8.com/ios-filled/344/instagram-new--v1.png" alt="icona" className="social-icon" />
                <img src="https://img.icons8.com/ios-filled/344/instagram-new--v1.png" alt="icona" className="social-icon" />
            </div>
        </SocialCard>

        <Footer/>
        </>
    )
}
export default Social;
